export default function AboutMe() {
    return (
        <div className = 'aboutMe-container'>
            <div className ='aboutMe-parent'>
                <div className = 'aboutMe-text'>
                    <img src={require ('../../assets/AboutMe/me.jpg').default} alt='no internet'/>
                </div>
            </div>
        </div>
    )
}
